import React from 'react';
import { Box, Container, Typography, Grid, Card, CardContent, Button } from '@mui/material';

function Rooms() {
  const rooms = [
    {
      id: 1,
      type: "Standard Room",
      price: "500.000",
      available: 5
    },
    {
      id: 2,
      type: "Deluxe Room",
      price: "800.000",
      available: 3
    }
  ];

  return (
    <Container>
      <Box sx={{ py: 4 }}>
        <Typography variant="h4" sx={{ mb: 4 }}>Room Management</Typography>
        <Grid container spacing={3}>
          {rooms.map((room) => (
            <Grid item xs={12} sm={6} md={4} key={room.id}>
              <Card>
                <CardContent>
                  <Typography variant="h5">{room.type}</Typography>
                  <Typography variant="body1" color="text.secondary">
                    Price: Rp {room.price}/night
                  </Typography>
                  <Typography variant="body1" color="text.secondary">
                    Available: {room.available} rooms
                  </Typography>
                  <Button 
                    variant="contained" 
                    fullWidth 
                    sx={{ mt: 2 }}
                  >
                    Edit Room
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Container>
  );
}

export default Rooms;
